function getColor(Name) {
    switch (Name) {
        case 'Departamento Rivadavia':
            return '#800026';
        case 'Rivadavia Banda Norte':
            return '#9e9ac8';
        case 'Rivadavia Banda Sur': // Agrega aquí la tercera categoría
            return '#810f7c'; // Asigna el color correspondiente a la tercera categoría
        case 'Santa Victoria': // Agrega aquí la tercera categoría
            return '#54278f'; // Asigna el color correspondiente a la tercera categoría
        default:
            return '#000000'; // Color por defecto si la categoría no coincide con ninguna de las especificadas
    }
}

function styleDpto(feature) {
    return {
        fillColor: getColor(feature.properties.Name),
        weight: 1,
        opacity: 1,
        color: 'white',
        dashArray: '0',
        fillOpacity: 0.6
    }
}

